webpackJsonp([0xb506c56865f3],{7518:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/85538623/" title="Photo Sharing"><img src="http://static.flickr.com/42/85538623_453ad2cade.jpg" width="500" height="207" alt="heimspiel" /></a></p>\n<p>World Cup doesn\'t start until summer, but Mama has already brought home her first World Cup swag. But I don\'t get it. Why the Denglish? We don\'t watch much TV, but apparently this is <a href="http://www.cokefridge.de/">Coca-Cola\'s main advertising slogan</a> in Germany for the tournament. Mama couldn\'t explain it either, she just shrugged and said "It\'s supposed to rhyme".</p>\n<p>So what slogan are they using in the rest of the world, "It\'s your Ausw&auml;rtsspiel"?</p>',fields:{title:"It's Your Heimspiel",date:"12 Jan 2006",url:"https://papascott.de/2006-01-12-its-your-heimspiel/"}}},pathContext:{slug:"/2006-01-12-its-your-heimspiel/",prev:{fields:{title:"Technical Translation",date:"11 Jan 2006",slug:"/2006-01-11-technical-translation/"}},next:{fields:{title:"Hermann",date:"13 Jan 2006",slug:"/2006-01-13-hermann/"}}}}}});
